INSERT INTO `cursocontabilidade` (`objetivoCurso`, `criteriosAvaliacao`, `estagio`, `perfilConclusao`, `gradeCurricular`, `horario`) VALUES
('<p style=\"text-align: left;\"><span style=\"font-size: 1rem;\">O Curso Técnico em Contabilidade objetiva desenvolver no aluno a excelência contábil, de maneira ética e organizada, transformando as informações em conhecimentos técnicos e operacionais inerentes à área de gestão e negócios.&nbsp;</span></p>', '<p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">A avaliação considerada como processo de construção do conhecimento combina procedimentos de avaliação de competências que se realiza de forma contínua, envolvendo teoria e prática.</span><br></p><p style=\"text-align: left; \"><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">O resultado é expresso pelos pareceres&nbsp;</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-weight: bolder; text-align: justify;\">Apto</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">&nbsp;e&nbsp;</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-weight: bolder; text-align: justify;\">Não Apto</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">.</span><br></p><p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">Quando o aluno, após as atividades de recuperação desenvolvidas durante o processo for considerado Não Apto, a escola oferece uma nova oportunidade, sendo retomados os conteúdos mínimos que propiciem aquisição de conhecimentos básicos para promoção da etapa seguinte: os estudos adicionais. No período de estudos adicionais, são retomadas as competências significativas para a promoção do aluno.</span><br></p><p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">A Escola exige do aluno o percentual de 75% de frequência nas atividades curriculares, conforme legislação vigente, oferecendo-lhe atividades compensatórias e presencias de infrequência.</span><br></p>', '', '<p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">O Técnico em Contabilidade deve ser um profissional capaz de desenvolver a excelência contábil, transformando as informações em conhecimentos técnicos e operacionais inerentes à área de gestão e negócios, bem como elaborar e avaliar projetos de empreendedorismos (Plano de negócios). Deve ser autogerenciador de seus serviços, adaptando-se às novas tecnologias, buscando o aperfeiçoamento técnico permanentemente. Ter iniciativa, criatividade, espírito empreendedor e ético para exercer a cidadania, contribuindo para a prática de gestão social.</span><br></p><p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">O Técnico em Contabilidade terá como competências:</span><br></p><ul><li style=\"text-align: justify; \">Fazer a escrituração contábil de acordo com os princípios da ética contábil, demonstrando o patrimônio das entidades econômico-administrativas das empresas comerciais e industriais nos seus aspectos financeiros e humanos</li><li style=\"text-align: justify;\">Promover a gestão de empreendimentos inovadores, utilizando sistemas gerenciais e legais que privilegiem as normas técnicas e de segurança e os princípios de proteção ambiental.</li><li style=\"text-align: justify;\">Realizar atividades de prática profissional relativas à contabilidade, aplicando a metodologia cientifica</li><li style=\"text-align: justify;\">Conhecer, aplicar e calcular as rotinas próprias inerentes aos recursos humanos</li><li style=\"text-align: justify;\">Analisar os dados concretos, aplicando fórmulas e interpretando os resultados obtidos para a tomada de decisão em uma entidade sócio-econômico-administrativo</li><li style=\"text-align: justify;\">Conhecer os conceitos e legislação básica do direito utilizados na profissão contábil</li><li style=\"text-align: justify;\">Identificar os riscos ocupacionais no ambiente de trabalho</li><li style=\"text-align: justify;\">Operacionalizar e pesquisar utilizando os softwares contábeis e seus aplicativos em pesquisa na prática contábil</li><li style=\"text-align: justify;\">Identificar os riscos ocupacionais no ambiente de trabalho</li><li style=\"text-align: justify;\">Operacionalizar e pesquisar utilizando os softwares contábeis e seus aplicativos em pesquisa na prática contábil</li><li style=\"text-align: justify;\">Reconhecer os usuários da análise de balanço e a sua utilidade para a entidade empresarial em sua gestão</li><li style=\"text-align: justify;\">Verificar a veracidade das demonstrações contábeis</li><li style=\"text-align: justify;\">Fazer exame minucioso das demonstrações contábeis</li><li style=\"text-align: justify;\">Aplicar os princípios contábeis nos relatórios contábeis</li><li style=\"text-align: justify;\">Elaborar balanço patrimonial e D.R.E</li><li style=\"text-align: justify; \">Calcular os índices socioeconômicos da entidade.</li></ul>', '<p style=\"text-align: justify; \">O curso está organizado em <strong>03 semestres</strong>. A organização curricular segue as condições necessárias à integração entre os componentes curriculares, organização e sequencia, de acordo com o perfil traçado, visando garantir as condições de empregabilidade e laboralidade ao aluno concluente.</p><p style=\"text-align: justify;\">O curso tem duração de <strong>1080 horas</strong>.</p><table class=\"table table-bordered\" style=\"text-align: center;\" border=\"1\"><tbody><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">1º SEMESTRE</span></h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">2º SEMESTRE</span></h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">3º SEMESTRE</span></h5></td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">160h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">CONTABILIDADE GERAL*</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">160h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">CONTABILIDADE COMERCIAL*</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">60h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">CONTABILIDADE INDUSTRIAL</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><p>DIREITO E LEGISLAÇÃO*</p></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">CONTABILIDADE PÚBLICA</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">DIREITO E LEGISLAÇÃO</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ORGANIZAÇÃO E TÉCNICAS COMERCIAIS</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">DIREITO E LEGISLAÇÃO</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ORGANIZAÇÃO E TÉCNICAS COMERCIAIS<br></td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ESTATÍSTICA APLICADA A CONTABILIDADE *</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ORGANIZAÇÃO E TÉCNICAS COMERCIAIS</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">PORTUGUÊS INSTRUMENTAL</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">MATEMÁTICA FINANCEIRA *</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ESTATÍSTICA APLICADA A CONTABILIDADE<br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">METODOLOGIA DE PESQUISA</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INFORMÁTICA APLICADA A CONTABILIDADE</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">MATEMÁTICA FINANCEIRA<br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ANALISES DE BALANÇOS</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INGLÊS INSTRUMENTAL</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INFORMÁTICA APLICADA A CONTABILIDADE<br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">GESTÃO PÚBLICA</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ÉTICA E RELAÇÕES HUMANAS</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">METODOLOGIA DE PESQUISA<br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ECONOMIA E MERCADO</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">METODOLOGIA DE PESQUISA</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">20h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">GESTÃO EMPRESARIAL</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">SEGURANÇA DO TRABALHO</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">EMPREENDEDORISMO</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ECONOMIA E MERCADO</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">120h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">PRÁTICA SUPERVISIONADA</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\"><br></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ORIENTAÇÃO DE PRÁTICA SUPERVISIONADA</td></tr></tbody></table><p style=\"text-align: justify;\"><span style=\"font-size: 12px;\"><em><br></em></span></p><p style=\"text-align: justify;\"><span style=\"font-size: 12px;\"><em><b>* Pré-requisito</b> para o semestre seguinte</em></span></p>', NULL);

