INSERT INTO `cursoinformatica` (`id`, `objetivoCurso`, `criteriosAvaliacao`, `estagio`, `perfilConclusao`, `gradeCurricular`, `horario`) VALUES
(1, '<p style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">O Curso Técnico em Informática oferece formação de nível subsequente e preconiza a formação de profissional habilitado para atuar no setor de informática, bem como forma profissionais com competências técnicas para ingressar no mundo do trabalho, atualizadas nas bases e formas de gestão da informática, contribuindo de maneira significativa para o desenvolvimento humano e sustentável da comunidade.</span></p>', '<p style=\"text-align: left;\"><span style=\"font-size: 1rem; text-align: justify; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\">A avaliação considerada como processo de construção do conhecimento combina procedimentos de avaliação de competências que se realiza de forma contínua, envolvendo teoria e prática.</span><br></p><p style=\"text-align: left;\"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; box-sizing: border-box; text-align: justify;\">O resultado é expresso pelos pareceres&nbsp;</span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; box-sizing: border-box; font-weight: bolder; text-align: justify;\">Apto</span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; box-sizing: border-box; text-align: justify;\">&nbsp;e&nbsp;</span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; box-sizing: border-box; font-weight: bolder; text-align: justify;\">Não Apto</span><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; box-sizing: border-box; text-align: justify;\">.</span><br></p><p style=\"text-align: left;\"><span style=\"font-size: 1rem; text-align: justify; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\">Quando o aluno, após as atividades de recuperação desenvolvidas durante o processo for considerado Não Apto, a escola oferece uma nova oportunidade, sendo retomados os conteúdos mínimos que propiciem aquisição de conhecimentos básicos para promoção da etapa seguinte: os estudos adicionais. No período de estudos adicionais, são retomadas as competências significativas para a promoção do aluno.</span><br></p><p style=\"text-align: left;\"><span style=\"font-size: 1rem; text-align: justify; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;;\">A Escola exige do aluno o percentual de 75% de frequência nas atividades curriculares, conforme legislação vigente, oferecendo-lhe atividades compensatórias e presencias de infrequência.</span></p>', '<p style=\"text-align: left;\"><span style=\"font-size: 1rem; text-align: justify;\">O estágio curricular obrigatório oportuniza a vivência da integração entre a teoria e a prática fora do ambiente pedagógico. É realizado no quarto semestre do curso, em empresa ou propriedade do setor público ou privado que exija ou necessite de profissional na área de Informática. O estágio é realizado sob a orientação do professor da disciplina de orientação de Estágio e deve ter a duração de 400 horas..</span><br></p>', '<p style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">O Técnico em Informática - Eixo Tecnológico Informação e Comunicação da Escola Estadual de Ensino Médio Prof.ª Maria Rocha - deve ser capaz de dar suporte aos usuários de informática em serviços de montagem e manutenção de computadores, em instalação e configuração de redes, de desenvolver banco de dados e programação, desenvolver e atualizar sites, instalar e configurar sistemas operacionais e elaborar e avaliar projetos na área de informática, contemplando uma visão empreendedora.</span></p><p><div style=\"text-align: justify;\"><br></div><span style=\"font-size: 1rem;\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">O Técnico em Informática é um profissional qualificado para compreender e tomar decisões relativas às mais diversas áreas de informática. Esse profissional deve demonstrar competências de:</span></div></span></p><ul><li style=\"text-align: justify;\">Operar, instalar, configurar e fazer manutenção de sistemas operacionais e aplicativos</li><li style=\"text-align: justify;\">Construir, instalar e realizar a manutenção de banco de dados</li><li style=\"text-align: justify;\">Instalar, configurar e fazer manutenção de computadores</li><li style=\"text-align: justify;\">Construir, instalar e realizar a manutenção de softwares</li><li style=\"text-align: justify;\">Instalar, configurar e operar redes de computadores.</li><li style=\"text-align: justify;\">Elaborar, implementar e monitorar projetos de sistemas web</li><li style=\"text-align: justify;\">Elabora e avaliar projetos de empreendedorismo na área da informática</li><li style=\"text-align: justify;\">Elaborar projetos de pesquisa aplicando metodologia científica</li><li style=\"text-align: justify;\">Identificar os riscos ocupacionais do ambiente de trabalho</li><li style=\"text-align: justify;\">Conhecer os conceitos de legislação básica do direito utilizados na profissão de informática.</li></ul>', '<p style=\"text-align: left; \"><span style=\"font-family: &quot;Verdana&quot;;\"></span><span style=\"font-size: 1rem; text-align: justify;\">O curso está organizado em: </span><b style=\"font-size: 1rem; text-align: justify;\">04 (quatro) semestres</b><span style=\"font-size: 1rem; text-align: justify;\">&nbsp;acrescidos das horas de estágio curricular obrigatório. O curso tem a duração de&nbsp;</span><b style=\"font-size: 1rem; text-align: justify;\">1200 horas</b><span style=\"font-size: 1rem; text-align: justify;\">&nbsp;relógio e&nbsp;</span><b style=\"font-size: 1rem; text-align: justify;\">400 horas</b><span style=\"font-size: 1rem; text-align: justify;\">&nbsp;relógio de estágio curricular supervisionado.</span></p><pre><table class=\"table table-bordered\" style=\"text-align: center;\"><tbody><tr><td style=\"background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">1º </span><span style=\"font-family: &quot;Verdana&quot;;\">SEMESTRE</span></h5></td><td style=\"background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">2º SEMESTRE</span></h5></td><td style=\"background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">3º SEMESTR</span><span style=\"font-family: &quot;Verdana&quot;;\">E</span></h5></td><td style=\"background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">4º SEMESTRE</span></h5></td></tr><tr><td style=\"background-color: rgb(209, 213, 216);\">100h</td><td>PROGRAMAÇÃO I*</td><td style=\"background-color: rgb(209, 213, 216);\">100h</td><td>PROGRAMAÇÃO II*</td><td style=\"background-color: rgb(209, 213, 216);\">100h</td><td>PROGRAMAÇÃO III<br></td><td style=\"background-color: rgb(209, 213, 216);\">20h</td><td>METODOLOGIA DE PESQUISA</td></tr><tr><td style=\"background-color: rgb(209, 213, 216);\">60h</td><td><p>MONTAGEM E MANUTENÇÃO I*<br></p></td><td style=\"background-color: rgb(209, 213, 216);\">80h</td><td><p>MONTAGEM E MANUTENÇÃO II*<br></p></td><td style=\"background-color: rgb(209, 213, 216);\">80h</td><td>MONTAGEM E MANUTENÇÃO III<br></td><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>ORIENTAÇÃO DE ESTÁGIO</td></tr><tr><td style=\"background-color: rgb(209, 213, 216);\">100h</td><td>SISTEMAS APLICATIVOS I*<br></td><td style=\"background-color: rgb(209, 213, 216);\">100h</td><td>SISTEMAS APLICATIVOS II<br></td><td style=\"background-color: rgb(209, 213, 216);\">60h</td><td>LINUX E APLICATIVOS</td><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>PRÁTICA SUPERVISIONADA</td></tr><tr><td style=\"background-color: rgb(209, 213, 216);\">100h</td><td>EDITORAÇÃO GRÁFICA</td><td style=\"background-color: rgb(209, 213, 216);\">80h</td><td>PROGRAMAÇÃO WEB I*<br></td><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td><p>PROGRAMAÇÃO WEB II</p></td><td><br></td><td><br></td></tr><tr><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td><p>INTERNET</p></td><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>FUNDAMENTOS DA ADMINISTRAÇÃO</td><td style=\"background-color: rgb(209, 213, 216);\">60h</td><td>ESTATÍSTICA</td><td><br></td><td><br></td></tr><tr><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>CONTABILIDADE GERAL</td><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>DIREITO E LEGISLAÇÃO</td><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>PORTUGUÊS INSTRUMENTAL</td><td><br></td><td><br></td></tr><tr><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>ÉTICA E RELAÇÕES HUMANAS</td><td style=\"background-color: rgb(209, 213, 216);\">20h</td><td>METODOLOGIA DE PESQUISA</td><td style=\"background-color: rgb(209, 213, 216);\">80h</td><td>INGLÊS INSTRUMENTAL</td><td><br></td><td><br></td></tr><tr><td style=\"background-color: rgb(209, 213, 216);\">20h</td><td>PORTUGUÊS INSTRUMENTAL</td><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>SEGURANÇA DO TRABALHO</td><td style=\"background-color: rgb(209, 213, 216);\">40h</td><td>METODOLOGIA DE PESQUISA</td><td><br></td><td><br></td></tr></tbody></table></pre><p style=\"text-align: left; \"><em><br></em></p><p style=\"text-align: left; \"><b><em>*</em></b><span style=\"font-size: 12px; text-align: justify;\"><em><b>Pré-requisito</b> para o próximo semestre</em><br></span></p>', NULL);

