CREATE TABLE `cursosecretariado` (
  `objetivoCurso` longtext,
  `criteriosAvaliacao` longtext,
  `estagio` longtext,
  `perfilConclusao` longtext,
  `gradeCurricular` longtext,
  `horario` varchar(100) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

--
-- Extraindo dados da tabela `cursosecretariado`
--

INSERT INTO `cursosecretariado` (`objetivoCurso`, `criteriosAvaliacao`, `estagio`, `perfilConclusao`, `gradeCurricular`, `horario`) VALUES
('<p style=\"text-align: justify; \">O Curso Técnico em Secretariado forma um profissional que atue com dinamismo, gerenciando as mais diversas situações, de maneira compreensível, ética e responsável, bem como assessore diferentes setores e pessoas, coordene equipes, gere fluxo de informações da empresa e atue junto ao público interno e externo.</p>', '<p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">A avaliação considerada como processo de construção do conhecimento combina procedimentos de avaliação de competências que se realiza de forma contínua, envolvendo teoria e prática.</span><br></p><p style=\"text-align: left; \"><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">O resultado é expresso pelos pareceres&nbsp;</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-weight: bolder; text-align: justify;\">Apto</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">&nbsp;e&nbsp;</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-weight: bolder; text-align: justify;\">Não Apto</span><span style=\"font-size: 1rem; box-sizing: border-box; color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">.</span><br></p><p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">Quando o aluno, após as atividades de recuperação desenvolvidas durante o processo for considerado Não Apto, a escola oferece uma nova oportunidade, sendo retomados os conteúdos mínimos que propiciem aquisição de conhecimentos básicos para promoção da etapa seguinte: os estudos adicionais. No período de estudos adicionais, são retomadas as competências significativas para a promoção do aluno.</span><br></p><p style=\"text-align: left; \"><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem; text-align: justify;\">A Escola exige do aluno o percentual de 75% de frequência nas atividades curriculares, conforme legislação vigente, oferecendo-lhe atividades compensatórias e presencias de infrequência.</span></p>', '<p style=\"text-align: justify; \">O estágio curricular obrigatório oportuniza a vivencia da integração entre a teoria e a pratica fora do ambiente pedagógico. É realizado no terceiro semestre do curso, em presa ou propriedade de setor público ou privado que exija ou necessite de um profissional na área de secretariado. O estágio é realizado sob a orientação do professor de disciplina de orientação de estágio e deve ter a duração de <b>200 horas</b>.</p>', '<p style=\"text-align: justify; \">O Técnico em Secretariado atende ao publico e assessora chefias em empresas publicas, privadas e do terceiro setor. Utiliza tecnologias e comunicação nas diversas formas, inclusive em língua estrangera. Organiza arquivos e sistematiza documentos técnicos. Atuam no planejamento, execução e avaliação de eventos. É um profissional ético, preocupado com o meio ambiente, proativo e responsável, trabalha em equipe, valoriza a produtividade e qualidade no local de trabalho, mantendo postura adequado no exercício da profissão.</p><p style=\"text-align: justify; \">O Técnico em Secretariado terá com competências:</p><ul><li style=\"text-align: justify; \">Viabilizar aprendizagem de conhecimentos e competências essenciais para o exercício da profissão</li><li style=\"text-align: justify; \">Investir no uso de tecnologias educacionais que remetem o aluno às mudanças continuas das áreas de atuação</li><li style=\"text-align: justify; \">Formar profissionais capazes de interagir nas diversas situações do mundo do trabalho</li><li style=\"text-align: justify; \">Exercer funções gerenciais, condomínio sobre planejamento, organização,direção e controle</li><li style=\"text-align: justify; \">Proporcionar condições de alto desenvolvimento no Eixo Tecnológico Gestão e Negócios, propondo inovações para incorporar novos métodos e técnicas que respondam às situações cotidianas e inusitadas com criatividade, assertividade, flexibilidade e adaptabilidade</li><li style=\"text-align: justify; \">Proporcionar a todas as áreas de Santa Maria e região melhores condições de atendimento ao cliente, colocando-lhes a disposição profissional tecnicamente qualificados</li><li style=\"text-align: justify; \">Conhecer os conteúdos básicos do direito, bem como trabalhar a legislação civil, empresarial, trabalhista, previdenciária e constitucional numa perspectiva de apoio aos serviços de secretariado. Fornecer alimentos técnico-jurídicos para o exercício pleno da profissional e vida social critica</li><li style=\"text-align: justify; \">Tornar um profissional ético, proativo, responsável, com uma visão holística, flexível e de bons relacionamentos interpessoais.</li></ul>', '<p style=\"text-align: justify; \">O curso está organizado em <strong>3 semestre</strong>. A organização curricular segue as condições necessárias à integração entre os componentes curriculares, organização e sequência, de acordo com o perfil traçado, visando garantir as condições de empregabilidade e laborabilidade ao aluno concluinte.</p><p style=\"text-align: justify; \">O curso tem a duração de <strong>870 horas</strong>, mais <strong>200 horas de estágio</strong> curricular supervisionado.</p><pre><table class=\"table table-bordered\" border=\"1\"><tbody><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">1º SEMESTRE</span></h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">2º SEMESTRE</span></h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5>CH</h5></td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\"><h5><span style=\"font-family: &quot;Verdana&quot;;\">3º SEMESTRE</span></h5></td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">DIREITO E LEGISLAÇÃO*</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">DIREITO E LEGISLAÇÃO</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INGLÊS INSTRUMENTAL</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ESTATÍSTICA*</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">ESTATÍSTICA</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">PORTUGUÊS INSTRUMENTAL</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">60h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INFORMÁTICA</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">60h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">INFORMÁTICA</td><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">40h</td><td style=\"text-align: center; border-color: rgb(45, 46, 48);\">METODOLOGIA DE PESQUISA</td></tr><tr><td style=\"text-align: center; border-color: rgb(45, 46, 48); background-color: rgb(209, 213, 216);\">60h</td><td style=\"text-align: 