INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`, `thumbnail`, `arquivo`) VALUES
(127, 'Edital - Licitação Bar da escola', '<p>Interessado em participar da licitação do BAR da escola? <a href=\"http://bit.ly/2VEkuiN\" target=\"_blank\">clique aqui!</a><br></p>', 'guiselair', 0, '08/07/2019 20:30:16', NULL, NULL),
(132, 'Abertura de Licitação para o Bar da escola', '<p><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">Interessados acessar a aba Editais para ter acesso ao edital ou <a href=\"http://www.mariarocha.org.br/editais.php?pagina=0\" target=\"_blank\">clique aqui!</a></span><br></p>', 'guiselair', 1, '10/07/2019 00:25:00', '15627291005d255a8c0e985.jpg', NULL),
(133, 'Processo Seletivo - 2019/2', '<p><span style=\"color: rgb(33, 37, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">Interessados em fazer a inscrição para os Cursos Técnicos,&nbsp;</span><a href=\"http://servicos.educacao.rs.gov.br/pse/srv/matricula.jsp?ACAO=acao5\" style=\"box-sizing: border-box; color: rgb(53, 70, 152); background-color: rgb(255, 255, 255); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; text-align: justify;\">cliquem aqui!</a><br></p>', 'guiselair', 1, '10/07/2019 00:25:50', '15627291505d255abe1bbcd.jpg', NULL),
(134, 'Processo Seletivo - Informações sobre a Prova', '<pre style=\"box-sizing: border-box; font-family: SFMono-Regular, Menlo, Monaco, Consolas, &quot;Liberation Mono&quot;, &quot;Courier New&quot;, monospace; font-size: 14.4px; text-align: center;\"><p style=\"box-sizing: border-box; text-align: left;\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: Helvetica;\">Comunicamos que as provas do Processo Seletivo para ingresso no II Semestre de 2019 ocorrerão no </span><span style=\"box-sizing: border-box; font-weight: bolder;\"><span style=\"box-sizing: border-box; font-family: Helvetica;\">SÁBADO - dia 13/07/2019</span></span><span style=\"box-sizing: border-box; font-family: Helvetica;\">, às </span><span style=\"box-sizing: border-box; font-weight: bolder;\"><span style=\"box-sizing: border-box; font-family: Helvetica;\">14h30</span></span><span style=\"box-sizing: border-box; font-family: Helvetica;\">.</span></span></p><p style=\"box-sizing: border-box; text-align: left;\"><span style=\"box-sizing: border-box; font-family: Helvetica;\">Pedimos que os candidatos cheguem 30min antes.&nbsp;</span></p><p style=\"box-sizing: border-box; text-align: left;\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: Helvetica;\">O portão será aberto às 14h00 e </span><span style=\"box-sizing: border-box; font-weight: bolder;\"><span style=\"box-sizing: border-box; font-family: Helvetica;\">fechado às 14h30</span></span><span style=\"box-sizing: border-box; font-family: Helvetica;\">, não sendo permitida a entrada de nenhum&nbsp;</span></span><span style=\"box-sizing: border-box; font-family: Helvetica;\">candidato depois deste horário.</span><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: Helvetica;\">&nbsp;</span><span style=\"box-sizing: border-box;\"><br style=\"box-sizing: border-box;\"></span><span style=\"box-sizing: border-box; font-weight: bold; font-family: Helvetica;\">Importante</span><span style=\"box-sizing: border-box; font-family: Helvetica;\">:</span><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: Helvetica;\">Trazer documento com foto e caneta azul ou preta.</span></p></pre>', 'guiselair', 1, '10/07/2019 00:26:27', '15627291875d255ae3a98f6.jpg', NULL),
(135, 'Edital - Processo Seletivo 2019/2', '<p>Para acessar o editar referente ao processo seletivo do 2º semestre de 2019. <a href=\"https://bit.ly/2wPIrK0\" target=\"_blank\">Clique aqui!</a></p><p>Através do editais você terá todas as informações sobre o processo.<br><br></p>', 'guiselair', 0, '10/07/2019 00:33:35', NULL, NULL);
